import React from "react";
import "./CustomNav.scss";

function CustomNav(props) {
  const showMobileNav = () => {
    let toggle = document.querySelector("#nav-body").style.display;
    console.log(toggle);
    if (toggle === "none") {
      document.querySelector("#nav-body").style.display = "block";
      document.querySelector(".icon").classList.remove("show");
      console.log("2");
    } else {
      document.querySelector("#nav-body").style.display = "none";
      document.querySelector(".icon").classList.add("show");
      console.log("1");
    }
  };
  return (
    <div className="custom-nav">
      <nav>
        <div className="icon" onClick={showMobileNav}>
          <div className="hamburger" />
        </div>
        <ul id="nav-body">
          <li className="active">
            <a href="#home">Home</a>
          </li>
          <li>
            <a href="#news">News</a>
          </li>
          <li>
            <a href="#contact">Contact</a>
          </li>
          <li>
            <a href="#about">About</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default CustomNav;
